$ErrorActionPreference = 'Stop'
$ProgressPreference = 'SilentlyContinue'
$script:AbortInstall = $false


& {

Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

# ==================== Theme ====================
$Theme = @{
    Background      = [System.Drawing.Color]::FromArgb(32,32,32)
    PanelBackground = [System.Drawing.Color]::FromArgb(45,45,48)
    TextPrimary     = [System.Drawing.Color]::White
    TextSecondary   = [System.Drawing.Color]::Gainsboro
    Accent          = [System.Drawing.Color]::FromArgb(0,122,204)
    LogBackground   = [System.Drawing.Color]::FromArgb(30,30,30)
}

# ==================== Optional Base64 Logo ====================
# Set to $null if you don't want a splash image yet
$Base64Logo = @"

"@

# ==================== Embedded Icon (Base64) ====================
$Base64Icon = @"

"@

function Convert-Base64ToImage {
    param ($Base64)
    $bytes = [Convert]::FromBase64String($Base64)
    $ms = New-Object System.IO.MemoryStream(,$bytes)
    [System.Drawing.Image]::FromStream($ms)
}

function Convert-Base64ToIcon {
    param ($Base64)

    $bytes = [Convert]::FromBase64String($Base64)
    $ms = New-Object System.IO.MemoryStream(,$bytes)
    New-Object System.Drawing.Icon($ms)
}

# ==================== Globals ====================
$GamExe = "C:\GAM7\gam.exe"
$script:Exiting = $false

# ==================== Helper Functions ====================
function Write-Log {
    param ($Text, [switch]$Header)

    if ($null -eq $RichTextBox -or $RichTextBox.IsDisposed) { return }

    if ($Header) {
        $RichTextBox.SelectionFont = New-Object System.Drawing.Font(
            "Consolas",10,[System.Drawing.FontStyle]::Bold
        )
        $RichTextBox.SelectionColor = $Theme.Accent
    } else {
        $RichTextBox.SelectionFont = $RichTextBox.Font
        $RichTextBox.SelectionColor = $Theme.TextSecondary
    }

    $RichTextBox.AppendText("$Text`r`n")
    $RichTextBox.ScrollToCaret()
}

function Exit-App {
    if ($script:Exiting) { return }
    $script:Exiting = $true
    [System.Windows.Forms.Application]::Exit()
}

function Ask-YesNo {
    param ($Message)

    [System.Windows.Forms.Application]::DoEvents()

    $result = [System.Windows.Forms.MessageBox]::Show(
        $Message,
        "GAM Setup",
        [System.Windows.Forms.MessageBoxButtons]::YesNo,
        [System.Windows.Forms.MessageBoxIcon]::Question
    )

    return ($result -eq [System.Windows.Forms.DialogResult]::Yes)
}


function Ask-Input {
    param ($Message)

    $f = New-Object System.Windows.Forms.Form
    $f.Text = "GAM Setup"
    $f.Size = New-Object System.Drawing.Size(520,220)
    $f.StartPosition = "CenterScreen"
    $f.FormBorderStyle = 'FixedDialog'
    $f.MaximizeBox = $false
    $f.MinimizeBox = $false
    $f.BackColor = $Theme.Background
    $f.TopMost = $true

    $lbl = New-Object System.Windows.Forms.Label
    $lbl.Text = $Message
    $lbl.ForeColor = $Theme.TextPrimary
    $lbl.AutoSize = $true
    $lbl.MaximumSize = New-Object System.Drawing.Size(480,0)
    $lbl.Location = New-Object System.Drawing.Point(10,10)

    $tb = New-Object System.Windows.Forms.TextBox
    $tb.Width = 480
    $tb.Location = New-Object System.Drawing.Point(10,70)

    $btn = New-Object System.Windows.Forms.Button
    $btn.Text = "OK"
    $btn.Width = 100
    $btn.Location = New-Object System.Drawing.Point(390,120)
    $btn.Add_Click({ $f.Close() })

    $f.Controls.AddRange(@($lbl,$tb,$btn))
    $f.ShowDialog() | Out-Null

    if ([string]::IsNullOrWhiteSpace($tb.Text)) { Exit-App }
    $tb.Text
}

function Pick-MSI {
    $dlg = New-Object System.Windows.Forms.OpenFileDialog
    $dlg.Filter = "MSI Files (*.msi)|*.msi"
    $dlg.Title = "Select GAM MSI Installer"

    $result = $dlg.ShowDialog()
    if ($result -ne [System.Windows.Forms.DialogResult]::OK) { Exit-App }

    return $dlg.FileName
}

# ==================== Main Form ====================
$Form = New-Object System.Windows.Forms.Form
$Form.Icon = Convert-Base64ToIcon $Base64Icon
$Form.Text = "GAM Installation & Setup"
$Form.Size = New-Object System.Drawing.Size(900,550)
$Form.StartPosition = "CenterScreen"
$Form.BackColor = $Theme.Background
$Form.FormBorderStyle = 'FixedSingle'
$Form.MaximizeBox = $false
$Form.TopMost = $true
$Form.ControlBox = $false

# Header
$HeaderPanel = New-Object System.Windows.Forms.Panel
$HeaderPanel.Dock = 'Top'
$HeaderPanel.Height = 70
$HeaderPanel.BackColor = $Theme.PanelBackground

$TitleLabel = New-Object System.Windows.Forms.Label
$TitleLabel.Text = "GAM Installation & Setup"
$TitleLabel.Font = New-Object System.Drawing.Font("Segoe UI",16,[System.Drawing.FontStyle]::Bold)
$TitleLabel.ForeColor = $Theme.TextPrimary
$TitleLabel.AutoSize = $true
$TitleLabel.Location = New-Object System.Drawing.Point(20,25)

$AccentBar = New-Object System.Windows.Forms.Panel
$AccentBar.Dock = 'Bottom'
$AccentBar.Height = 3
$AccentBar.BackColor = $Theme.Accent

$HeaderPanel.Controls.AddRange(@($TitleLabel,$AccentBar))
$Form.Controls.Add($HeaderPanel)

# Content Panel
$ContentPanel = New-Object System.Windows.Forms.Panel
$ContentPanel.Dock = 'Fill'
$ContentPanel.Padding = New-Object System.Windows.Forms.Padding(10,80,10,10)
$ContentPanel.BackColor = $Theme.Background

# Split content: Logs (left) + Splash (right)
$MainContentSplit = New-Object System.Windows.Forms.TableLayoutPanel
$MainContentSplit.Dock = 'Fill'
$MainContentSplit.ColumnCount = 2
$MainContentSplit.RowCount = 1
$MainContentSplit.ColumnStyles.Add(
    (New-Object System.Windows.Forms.ColumnStyle('Percent', 70))
)
$MainContentSplit.ColumnStyles.Add(
    (New-Object System.Windows.Forms.ColumnStyle('Percent', 30))
)

$MainContentSplit.RowStyles.Add(
    (New-Object System.Windows.Forms.RowStyle('Percent', 100))
)

$ContentPanel.Controls.Add($MainContentSplit)

$RichTextBox = New-Object System.Windows.Forms.RichTextBox
$RichTextBox.Dock = 'Fill'
$RichTextBox.ReadOnly = $true
$RichTextBox.BorderStyle = 'None'
$RichTextBox.BackColor = $Theme.LogBackground
$RichTextBox.ForeColor = $Theme.TextSecondary
$RichTextBox.Font = New-Object System.Drawing.Font("Consolas",10)
$RichTextBox.ScrollBars = 'Vertical'
$RichTextBox.HideSelection = $false


$LogWrapper = New-Object System.Windows.Forms.Panel
$LogWrapper.Dock = 'Fill'
$LogWrapper.Padding = New-Object System.Windows.Forms.Padding(0,8,0,0)
$LogWrapper.BackColor = $Theme.Background

$LogWrapper.Controls.Add($RichTextBox)
$MainContentSplit.Controls.Add($LogWrapper, 0, 0)

$SplashPanel = New-Object System.Windows.Forms.Panel
$SplashPanel.Dock = 'Fill'
$SplashPanel.BackColor = $Theme.Background
$SplashPanel.Padding = New-Object System.Windows.Forms.Padding(10)

$MainContentSplit.Controls.Add($SplashPanel, 1, 0)

# ==================== Splash Image ====================
if ($Base64Logo) {
    try {
        $Logo = Convert-Base64ToImage $Base64Logo

        $LogoBox = New-Object System.Windows.Forms.PictureBox
        $LogoBox.Image = $Logo
        $LogoBox.Dock = 'Fill'
        $LogoBox.SizeMode = 'Zoom'
        $LogoBox.BackColor = $Theme.Background

        $SplashPanel.Controls.Add($LogoBox)
    }
    catch {
        Write-Log "Failed to load splash image."
    }
}

$Form.Controls.Add($ContentPanel)

# ==================== Footer (Finish Button) ====================
$FooterPanel = New-Object System.Windows.Forms.Panel
$FooterPanel.Dock = 'Bottom'
$FooterPanel.Height = 55
$FooterPanel.Padding = New-Object System.Windows.Forms.Padding(10,10,10,10)
$FooterPanel.BackColor = $Theme.Background

$CloseButton = New-Object System.Windows.Forms.Button
$CloseButton.Text = "Finish"
$CloseButton.Width = 100
$CloseButton.Height = 30
$CloseButton.Enabled = $false
$CloseButton.Dock = 'Right'
$CloseButton.Margin = New-Object System.Windows.Forms.Padding(0,12,10,12)

$CloseButton.UseVisualStyleBackColor = $false
$CloseButton.BackColor = $Theme.Accent
$CloseButton.ForeColor = $Theme.TextPrimary
$CloseButton.FlatStyle = 'Flat'
$CloseButton.FlatAppearance.BorderSize = 0
$CloseButton.FlatAppearance.MouseOverBackColor = [System.Drawing.Color]::FromArgb(28,151,234)
$CloseButton.FlatAppearance.MouseDownBackColor = [System.Drawing.Color]::FromArgb(0,90,158)

$CloseButton.Add_Click({
    $Form.Close()
})

$FooterPanel.Controls.Add($CloseButton)
$Form.Controls.Add($FooterPanel)
$FooterPanel.BringToFront()


# Show form
$Form.Show()
$Form.Activate()
Start-Sleep -Milliseconds 300
$Form.TopMost = $false

Write-Log ""
Write-Log "Configuring environment variables..." -Header

$currentPath = [Environment]::GetEnvironmentVariable(
    "Path",
    [EnvironmentVariableTarget]::Machine
)
$newPath = "C:\GAM7"

Write-Log "Ensuring C:\GAM7 is present in the System PATH..."

if ($currentPath -notlike "*$newPath*") {
    Write-Log "Added C:\GAM7 to System PATH."
} else {
    Write-Log "C:\GAM7 already exists in System PATH." 
}

Write-Log "User environment variable required."


# ==================== Environment Variable Setup ====================

# 🔑 Force UI repaint BEFORE modal dialog
[System.Windows.Forms.Application]::DoEvents()

[System.Windows.Forms.MessageBox]::Show(
    "Please EDIT YOUR ENVIRONMENT VARIABLES FOR YOUR ACCOUNT and add the following USER variable:`n`n" +
    "Variable name: GAMCFGDIR`n" +
    "Variable value: C:\GAMConfig`n`n" +
    "How to do this:`n" +
    "1. Go to the Start menu`n" +
    "2. Search for 'Edit environment variables for your account'`n" +
    "3. Click New under User variables`n" +
    "4. Set Variable name to GAMCFGDIR`n" +
    "5. Set Variable value to C:\GAMConfig",
    "GAM Setup – Manual Step Required",
    [System.Windows.Forms.MessageBoxButtons]::OK,
    [System.Windows.Forms.MessageBoxIcon]::Information
) | Out-Null

Write-Log "Displayed instructions to edit user environment variables for the current account."

# ==================== Pre-flight ====================
Write-Log "Running pre-flight checks..."

$Folders = @("C:\GAM7","C:\GAMConfig","C:\GAMWork")
foreach ($Folder in $Folders) {
    if (-not (Test-Path $Folder)) {
        Write-Log "Creating folder: $Folder"
        New-Item -Path $Folder -ItemType Directory | Out-Null
    } else {
        Write-Log "Folder exists: $Folder"
    }
}

# ==================== Install GAM ====================
if (-not (Test-Path $GamExe)) {

    Write-Log "GAM not detected."

    if (-not (Ask-YesNo "Do you already have the GAM MSI installer downloaded?")) {
        Write-Log "Opening GAM download page..."
        Start-Process "https://github.com/GAM-team/GAM/releases"
        return
    }

    $MSIPath = Pick-MSI
    Write-Log "Installing GAM from:"
    Write-Log $MSIPath

    Start-Process "msiexec.exe" `
        -ArgumentList "/i `"$MSIPath`" /qn /norestart" `
        -Wait `
        -NoNewWindow `
       | Out-Null

    if (-not (Test-Path $GamExe)) {
        Write-Log "GAM installation failed."
        Exit-App
    }

    Write-Log "GAM installed successfully."
}
else {
    Write-Log "GAM already installed."
}

# ==================== Run Official GAM Setup ====================
$GamSetupBat = "C:\GAM7\gam-setup.bat"

if (-not (Test-Path $GamSetupBat)) {
    Write-Log "gam-setup.bat not found at $GamSetupBat"
    Exit-App
}

[System.Windows.Forms.MessageBox]::Show(
    "The official GAM setup wizard will now start.`n`n" +
    "Please complete all steps in the command window.`n" +
    "When finished, close the command window to continue.",
    "GAM Setup",
    [System.Windows.Forms.MessageBoxButtons]::OK,
    [System.Windows.Forms.MessageBoxIcon]::Information
) | Out-Null

Write-Log "Starting official GAM setup wizard..." -Header
Write-Log "A command window will open."
Write-Log "Complete all steps, then CLOSE the window."

$cmdArgs = '/k "set ""GAMCFGDIR=C:\GAMConfig"" && set ""GAMWORKDIR=C:\GAMWork"" && set ""PATH=%PATH%;C:\GAM7"" && mode con: cols=140 lines=40 && color 0B && ""C:\GAM7\gam-setup.bat"""'


$GamProcess = Start-Process `
    -FilePath "cmd.exe" `
    -ArgumentList $cmdArgs `
    -WorkingDirectory "C:\GAM7" `
    -PassThru


Write-Log "GAM setup is running..."
Write-Log "Close the command window when finished."

# Timer to watch for CMD exit
$ProcessTimer = New-Object System.Windows.Forms.Timer
$ProcessTimer.Interval = 1000

$ProcessTimer.Add_Tick({
    if ($GamProcess.HasExited) {
        $ProcessTimer.Stop()
        $ProcessTimer.Dispose()
        Write-Log "GAM installation and setup complete! Click Finish to close the installer" -Header
        $Form.ControlBox = $true
        $CloseButton.Enabled = $true
        $CloseButton.Focus()

    }
})
$ProcessTimer.Start()

[System.Windows.Forms.Application]::Run($Form) | Out-Null

} | Out-Null
exit 0

